import { ExportToCsv } from 'export-to-csv';

class ExportCSV {

    options = {
        fieldSeparator: ',',
        quoteStrings: '"',
        decimalSeparator: '.',
        showLabels: true,
        showTitle: true,
        title: 'CSV',
        useTextFile: false,
        useBom: true,
        useKeysAsHeaders: true,
    };

    static export(json) {
        const csvExporter = new ExportToCsv(options);
        csvExporter.generateCsv(json);
    }

}

export default ExportCSV;
